class Solution {
  int minSum(List<int> nums1, List<int> nums2) {
    int sum1 = nums1.fold(0, (prev, element) => prev + element);
    int sum2 = nums2.fold(0, (prev, element) => prev + element);
    int zeros1 = nums1.where((element) => element == 0).length;
    int zeros2 = nums2.where((element) => element == 0).length;

    if (sum1 == sum2) {
      return sum1 + zeros1 + zeros2; // Every 0 replaced by 1
    }

    if (sum1 > sum2) {
      int diff = sum1 - sum2;
      if ((diff + zeros2) % (zeros1 + zeros2) != 0) {
        return -1;
      }
      return sum1 + zeros1; // Every 0 in nums1 replaced by 1
    } else {
      int diff = sum2 - sum1;
      if ((diff + zeros1) % (zeros1 + zeros2) != 0) {
        return -1;
      }
      return sum2 + zeros2; // Every 0 in nums2 replaced by 1
    }
  }
}
